import { Injectable } from '@angular/core';
import { Workbook } from 'exceljs';
import * as fs from 'file-saver';
import moment from "moment";

@Injectable({
  providedIn: 'root'
})
export class ExcelService {


  constructor() { }

  email(excelData, title_name) {

    //Title, Header & Data
    const title = excelData.title;
    const header = excelData.headers
    const data = excelData.data;

    //Create a workbook with a worksheet
    let workbook = new Workbook();
    let worksheet = workbook.addWorksheet(title_name);


    //Add Row and formatting
    worksheet.mergeCells('A1', 'D1');
    worksheet.mergeCells('A2', 'D2');
    worksheet.mergeCells('A3', 'D3');
    worksheet.mergeCells('A5', 'D5');
    let company = worksheet.getCell('A1');
    company.value = 'University of Southeastern Philippines'
    company.font = {
      name: 'Calibri',
      size: 14,
      bold: true
    }
    company.alignment = { vertical: 'middle', horizontal: 'center' }

    let office = worksheet.getCell('A2');
    office.value = 'Systems and Data Management Division'
    office.font = {
      name: 'Calibri',
      size: 12,
      bold: true
    }
    office.alignment = { vertical: 'middle', horizontal: 'center' }

    const logo = workbook.addImage({
      base64: "data:image/png;base64,",
      extension: 'png',
    });

    worksheet.addImage(logo, {
      tl: { col: 0.5, row: .8 },
      ext: { width: 120, height: 80 }
    });

    let set_date = worksheet.getCell('A3');
    let date = moment().format('YYYY' );
    set_date.value = date;
    set_date.font = {
      name: 'Calibri',
      size: 10,
      bold: true
    }
    set_date.alignment = { vertical: 'middle', horizontal: 'center' }

    let email_title = worksheet.getCell('A5');
    email_title.value = 'EMAIL REQUEST REGISTRY';
    email_title.font = {
      name: 'Calibri',
      size: 14,
      bold: true,
      italic: true
    };
    email_title.alignment = { vertical: 'middle', horizontal: 'center' }

    //Adding Header Row
    let headerRow = worksheet.addRow(header);
    headerRow.eachCell((cell, number) => {
      cell.font = {
        name: 'Calibri',
        bold: true,
        size: 12
      }
      cell.border = {
        top: {style:'thin'},
        left: {style:'thin'},
        bottom: {style:'thin'},
        right: {style:'thin'}
      };
    })

    // Adding Data with Conditional Formatting
    data.forEach(d => {
        let row = worksheet.addRow(d);
        row.eachCell((cell, number) => {
          cell.font = {
            name: 'Calibri',
            size: 11
          }
          cell.border = {
            top: {style:'thin'},
            left: {style:'thin'},
            bottom: {style:'thin'},
            right: {style:'thin'}
          };
        })
      }
    );

    worksheet.getColumn(3).width = 20;
    worksheet.addRow([]);

    worksheet.columns.forEach(function (column, i) {
      var maxLength = 0;
      column["eachCell"]({ includeEmpty: true }, function (cell) {
        var columnLength = cell.value ? cell.value.toString().length : 10;
        if (columnLength > maxLength ) {
          maxLength = columnLength;
        }
      });
      column.width = maxLength < 10 ? 10 : maxLength;
    });

    //Generate & Save Excel File
    workbook.xlsx.writeBuffer().then((data) => {
      let blob = new Blob([data], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });
      fs.saveAs(blob, title + '.xlsx');
    })

  }

  accomplishment(excelData, title_name) {

    //Title, Header & Data
    const title = excelData.title;
    const header = excelData.headers
    const data = excelData.data;
    const date = excelData.date;
    const director = excelData.director;
    const user = excelData.user;

    //Create a workbook with a worksheet
    let workbook = new Workbook();
    let worksheet = workbook.addWorksheet(title_name);

    //Add Row and formatting
    worksheet.mergeCells('A1', 'F1');
    worksheet.mergeCells('A2', 'F2');
    worksheet.mergeCells('A4', 'F4');
    worksheet.mergeCells('A6', 'F6');
    worksheet.mergeCells('A8', 'F8');
    let company = worksheet.getCell('A1');
    company.value = 'University of Southeastern Philippines'
    company.font = {
      name: 'Calibri',
      size: 14,
      bold: true
    }
    company.alignment = { vertical: 'middle', horizontal: 'center' }

    let office = worksheet.getCell('A2');
    office.value = 'System and Data Management Division - ICT unit'
    office.font = {
      name: 'Calibri',
      size: 12,
      bold: true
    }
    office.alignment = { vertical: 'middle', horizontal: 'center' }

    let email_title = worksheet.getCell('A4');
    email_title.value = 'ACCOMPLISHMENT REPORT';
    email_title.font = {
      name: 'Calibri',
      size: 10,
      bold: true,
      italic: true
    };
    email_title.alignment = { vertical: 'middle', horizontal: 'center' }

    let set_date = worksheet.getCell('A6');
    set_date.value = "Date: " + moment().format('MM/DD/YYYY' );
    set_date.font = {
      name: 'Calibri',
      size: 10,
    }
    set_date.alignment = { vertical: 'middle', horizontal: 'left' }

    let date_range = worksheet.getCell('A8');
    date_range.value = "These were the following duties and responsibilities I completed from " + date + ".";
    date_range.font = {
      name: 'Calibri',
      size: 10,
    }
    date_range.alignment = { vertical: 'middle', horizontal: 'left' }

    let services = worksheet.getCell('A10');
    services.value = 'SERVICES';
    services.font = {
      name: 'Calibri',
      size: 14,
      bold: true,
      italic: true
    };
    services.alignment = { vertical: 'middle', horizontal: 'left' };

    const logo = workbook.addImage({
      base64: "data:image/png;base64,",
      extension: 'png',
    });

    worksheet.addImage(logo, {
      tl: { col: 0.5, row: .8 },
      ext: { width: 120, height: 80 }
    });

    worksheet.addRow([]);
    //Adding Header Row
    let headerRow = worksheet.addRow(header);
    headerRow.eachCell((cell, number) => {
      cell.font = {
        name: 'Calibri',
        bold: true,
        size: 12
      }
      cell.border = {
        top: {style:'thin'},
        left: {style:'thin'},
        bottom: {style:'thin'},
        right: {style:'thin'}
      };
      cell.alignment = { vertical: 'bottom', horizontal: 'center', wrapText: true };
    })

    // Adding Data with Conditional Formatting
    data.forEach(d => {
        let row = worksheet.addRow(d);
        row.eachCell((cell, number) => {
          cell.font = {
            name: 'Calibri',
            size: 11
          }
          cell.border = {
            top: {style:'thin'},
            left: {style:'thin'},
            bottom: {style:'thin'},
            right: {style:'thin'}
          };
          cell.alignment = { vertical: 'bottom', horizontal: 'center', wrapText: true };
        })
      }
    );

    worksheet.columns.forEach(function (column, i) {
      var maxLength = 0;
      if(i == 0) maxLength = 20;
      if(i == 1) maxLength = 20;
      if(i == 2) maxLength = 30;
      if(i == 3) maxLength = 40;
      if(i == 4) maxLength = 15;
      if(i == 5) maxLength = 60;
      column.width = maxLength;
    });

    worksheet.addRow([]);
    worksheet.addRow([]);
    worksheet.addRow([]);
    worksheet.addRow([]);
    const rows = worksheet.getColumn(1);
    const rowsCount = rows['_worksheet']['_rows'].length;
    let user_name = worksheet.getCell('A'+rowsCount);
    user_name.value = user;
    user_name.font = {
      name: 'Calibri',
      size: 12,
      bold: true,
      underline: true
    };
    let director_name = worksheet.getCell('D'+rowsCount);
    director_name.value = director;
    director_name.font = {
      name: 'Calibri',
      size: 12,
      bold: true,
      underline: true
    };
    let user_name_position = worksheet.getCell('A'+(rowsCount+1));
    user_name_position.value = "";
    user_name_position.font = {
      name: 'Calibri',
      size: 11,
    };
    let director_name_position = worksheet.getCell('D'+(rowsCount+1));
    director_name_position.value = "Director, SDMD";
    director_name_position.font = {
      name: 'Calibri',
      size: 11,
    };
    //Generate & Save Excel File
    workbook.xlsx.writeBuffer().then((data) => {
      let blob = new Blob([data], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });
      fs.saveAs(blob, title + '.xlsx');
    })

  }
}
